var validSC63315 protobuf.SC_63315
var validSC11752 protobuf.SC_11752
var validSC22001 protobuf.SC_22001
var validSC26120 protobuf.SC_26120

// CS10023 awaits a lot of other packets of response.
//   - SC11000 -> Timestamp
//   - SC11003 -> Player info
//   - SC11015 -> Player's buffs
//   - SC63315 -> ?
//   - SC11752 -> Other player infos
//   - SC22001 -> Misc regarding Oil / Coin wells
//   - SC26120 -> Event stuff?

func PlayerInfo(buffer *[]byte, client *connection.Client) (int, int, error) {
	response := validSC11003
	response.Id = proto.Uint32(uint32(client.Commander.CommanderID))
	response.Name = proto.String(client.Commander.Name)
	response.Level = proto.Uint32(uint32(client.Commander.Level))
	response.Exp = proto.Uint32(uint32(client.Commander.Exp))

	response.RandomShipList = []uint32{}
	response.TakingShipList = []*protobuf.SHIP_TAKING_DATA{}

	response.ChildDisplay = proto.Uint32(1004)

	// Get user's secretaries
	secretaries := client.Commander.GetSecretaries()
	response.Character = make([]uint32, len(secretaries))
	for i, secretary := range secretaries {
		response.Character[i] = uint32(secretary.ID)
	}
	if len(response.Character) == 0 {
		logger.LogEvent("Server", "PlayerInfo", "No secretaries found", logger.LOG_LEVEL_ERROR)
		return 0, 11003, nil
	}

	response.ResourceList = make([]*protobuf.RESOURCE, len(client.Commander.OwnedResources))
	for i, resource := range client.Commander.OwnedResources {
		response.ResourceList[i] = &protobuf.RESOURCE{
			Type: proto.Uint32(resource.ResourceID),
			Num:  proto.Uint32(resource.Amount),
		}
	}

	response.ChatRoomId = proto.Uint32(client.Commander.RoomID)
	return client.SendMessage(11003, &response)
}

